// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
pragma experimental ABIEncoderV2;
import "./models/Agente.sol";
import "./models/InfoContrato.sol";
import "./Comercializador.sol";
import "./ReguladorMercado.sol";
import "./TokenErc20/ERC20.sol";

contract Cliente is Agente {
    address public contratoComercializador;
    uint256 public nit;
    string public contacto;
    string public telefono;
    string public correo;
    string public direccion;
    string public ciudad;
    string public departamento;

    struct InfoEnergia {
        uint256 cantidad;
        string nombreTipoEnergia;
    }

    InfoEnergia[] public energias;
    event NecesidadEnergia(string, uint256);

    constructor(
        string memory _empresa,
        uint256 _nit,
        string memory _contacto,
        string memory _telefono,
        string memory _correo,
        string memory _direccion,
        string memory _ciudad,
        string memory _departamento,
        address _direction,
        address _reguladorMercado
    ) {
        owner = _direction;
        dirContrato = address(this);
        empresa = _empresa;
        nit = _nit;
        contacto = _contacto;
        telefono = _telefono;
        correo = _correo;
        direccion = _direccion;
        ciudad = _ciudad;
        departamento = _departamento;
        reguladorMercado = _reguladorMercado;
    }

    function contratarComercializador(address _contratoComercializador)
        public
        authorize(msg.sender)
    {
        uint256 tipoComercializador = Comercializador(_contratoComercializador)
            .getTipoContrato();
        require(
            tipoComercializador == 1,
            "El comercializador debe ser de tipo Cliente"
        );
        contratoComercializador = _contratoComercializador;
        Comercializador(_contratoComercializador).setClientesComercializador(
            msg.sender
        );
    }

    function comprarEnergia(
        string memory _tipoEnergia,
        uint256 _cantidadEnergia
    ) public authorize(msg.sender) {
        require(
            contratoComercializador != address(0),
            "No tienes contrato de comercializador"
        );
        require(
            Comercializador(contratoComercializador).getTipoContrato() == 1,
            "El comercializador debe ser de tipo Cliente"
        );
        emit NecesidadEnergia(_tipoEnergia, _cantidadEnergia);
    }

    function getEnergias() public view returns (InfoEnergia[] memory) {
        
        return energias;
    }
}
